if mibBuilder.loadTexts: cdot3OamMaxOamPduSize.setDescription('The largest OAMPDU that the OAM entity supports. OAM entities exchange maximum OAMPDU sizes and negotiate to use the smaller of the two maximum OAMPDU sizes between the peers. This value is determined by the local implementation. ')
cdot3OamConfigRevision = MibTableColumn((1, 3, 6, 1, 4, 1, 9, 10, 136, 1, 1, 1, 5), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 65535))).setMaxAccess("readonly")
