cdot3OamFunctionsSupported = MibTableColumn((1, 3, 6, 1, 4, 1, 9, 10, 136, 1, 1, 1, 6), Bits().clone(namedValues=NamedValues(("unidirectionalSupport", 0), ("loopbackSupport", 1), ("eventSupport", 2), ("variableSupport", 3)))).setMaxAccess("readonly")
if mibBuilder.loadTexts: cdot3OamFunctionsSupported.setReference('[802.3ah], 30.3.6.1.6')
